import Settings from "./components/templates/Settings";
import Template from "./components/templates/template-0";

const App = () => {
  return (
    <div className="flex">
      <div className="h-screen w-1/4 bg-gray-500">
        <Template />
      </div>
      <div className="h-screen w-1/4 bg-gray-500">
        <Settings />
      </div>
      <div className="w-1/2 bg-green-200"></div>
    </div>
  );
};

export default App;
